import React from "react";
import "./style.css";
import articleData from "./articledata";
import Navbar from "./Navbar";
import Headline from "./Headline";
import Article from "./Article";
import TwoStepArticle from "./TwoStepArticle";

class App extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <div id="nav-filler"></div>
        <Headline />
        {articleData.map(item => {
          {
            articleData.map(item => {
              if (item.title === "I need access to a network drive") {
                console.log("This is the if article: " + item.title);
              } else {
                console.log("These are the else articles: " + item.title);
                <Article
                  category={item.category}
                  title={item.title}
                  subtitle={item.subtitle}
                  description={item.description}
                  instructions={item.instructions.map(item => (
                    <li>{item}</li>
                  ))}
                  img={item.img}
                  alt={item.alt}
                />;
              }
            })
          }
        })}
      </div>
    );
  }
}

export default App;
